import { ApiResponse } from '@components/common/types'
import request from '../request'
import constants from '@config/constants'

const {
  API: { routes }
} = constants

type IBooks = {}

const getBooks = (filter: Record<string, string | boolean | number | undefined>): ApiResponse<IBooks> =>
  request.get({ route: routes.searchBooks, params: { ...filter, title: filter.title || '' } })

const auth = {
  getBooks
}

export default auth
